    iter->parent = *ptr;
    iter->prop = (PropertyRNA *)&rna_ThemeSequenceEditor_rna_properties;

    rna_builtin_properties_begin(iter, ptr);

    if (iter->valid)
        iter->ptr = ThemeSequenceEditor_rna_properties_get(iter);
